import classes from "./Cart.module.css";

const Cart = ()=>{
    return <div>
        <div className={classes['cart-items']}>
            <ul>
                <li>Sushi</li>
                <li>Pani Puri</li>
            </ul>
        </div>
    </div>
}

export default Cart;
